import base64
import re

# Replace this with your full Base64 data (without the data: prefix)
data = "data:application/octet-stream;base64,"
# If your string has the 'data:application/octet-stream;base64,' prefix, remove it
if data.startswith("data:application/octet-stream;base64,"):
    data = data.split(",")[1]

# Decode Base64
binary_data = base64.b64decode(data)

# Extract all readable ASCII sequences (4+ printable chars)
ascii_strings = re.findall(rb'[\x20-\x7E]{4,}', binary_data)

print("Decoded ASCII strings found in payload:\n")
for s in ascii_strings:
    print(s.decode())
